        if(mail.length==""){
             alert("enter the value") ;
        }
        else{
      console.log(mail)
        }
    }

  return (
    <>
    <div className="main">
      <div className="container">
        <h2>Log in here</h2>
        <input placeholder='Enter your Email' ref={email}/>
        <input type="submit" value="send" onClick={sendOtp} />
      </div>
      </div>
      </>
  )
}

export default Home;
